script: |
  super -f text -I q7378.spq | sort > q7378.out

inputs:
  - name: q7378.spq
    data: |
      SELECT DISTINCT + col0 FROM tab1 (FORMAT parquet) AS cor0 WHERE + 40 NOT BETWEEN - col0 AND ( - col1 + - + 55 * 73 + - + col0 - col0 + col1 * - col2 );
  - name: tab1

outputs:
  - name: q7378.out
    data: |
      51
      85
      91
